.c-option {
  display: flex;
  justify-content: flex-start;
  align-items: stretch;
  padding: 1px 8px 0;
  margin: 1px 0 10px;

  &__text {
    display: flex;
    justify-content: flex-start;
    align-items: center;
    color: rgba(0, 0, 0, 0.54);
    font: 12px/14px Roboto, HelveticaNeue, Arial, sans-serif;
    padding: 0 8px 0 16px;
  }

  &-item {
    display: flex;
    justify-content: flex-start;
    align-items: stretch;
    max-width: 203px;
    min-width: 128px;
    height: 48px;
    padding: 0 13px 0 8px;
    margin: 0 4px;
    border-radius: 8px;
    box-shadow: 0 1px 6px rgba(32, 33, 36, 0.28);

    &__image {
      width: 48px;
      margin: 0 8px 0 -8px;
      background-color: #f2f2f2;
      border-radius: 8px 0 0 8px;
    }

    &__content {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: flex-start;
      font-size: 12px;
    }
  }
}
